  \"2015-07-08T19:25:09.832676\",\n\t\"name\": \"coordinated-eastern-arctic-experiment-cearex-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"CEAREX was a multi-platform field program
  conducted in the NorwegiannSeas and Greenland north to Svalbard from September 1988
  through Mayn1989. Canada, Denmark, France, Norway and the United Statesnparticipated
  in the experiment. Primary data from CEAREX are availablenon FTP in ASCII format
  along with some data from the Marginal IcenZone Experiment (MIZEX) and the Eurasian
  Basin Experiment (EUBEX).nnMeteorology data from CEAREX and the MIZEX (1983, 1984,
  1987) include near-surface time series and rawinsonde (upper-air sounding) profiles
  of wind, pressure, temperature, and humidity collected on ship platforms and ice
  floe stations. A collection of hydrography data include CTD, STD, and bottle data
  nfrom a ship and two operations camps. Hydrography data also include data from the
  MIZEX, the EUBEX, NODC archives, and a merged set of data from five other cruises.
  Sea ice data consist of compressive stress measurements made in a multi-year floe,
  stress sensor data for time series of stress invariants, nand ice accelerometer
  data for movements associated with the deformation of multi-year ice floes. Noise
  data consist of acoustic measurements from a variety of hydrophone and geophone
  arrays, and ambient noise observations from a ship using omni-directional hydrophones
  tethered beneath the ice cover. Biophysical data include bottle sample, zooplankton
  sampling, and nbioluminescence data. Bathymetry data consist of gridded trackline
  data collected from the two operations camps, and digital bottom bathymetry and
  continental topography data for the Fram Strait region and a portion of the Arctic
  Ocean. Sample position data consist of hourly listings of position and nvelocity
  for both manned stations and unmanned drifting buoys. Data are available via FTP.\",\n\t\"license_title\":
